        <main>
            <form class="form-horizontal" action="http://html5-book.co.il/teach/forms/get_form2.php" method="get">
                <div class="form-group">
                    <label><h6>שם מלא:</h6></label>
                    <input type="text" class="form-control" required name="fullName">
                </div>
                <br>
                <div class="form-group">
                <label><h6>מספר ליצירת קשר (לא בשבת):</h6></label>
                <input type="tel" pattern="[0-9]" class="form-control" name="phone" title="יש להקיש ספרות בלבד">
                </div>
                <br>
                <div class="form-group">
                    <label for="exampleEmailInput1"><h6>כתובת מייל כשרה:</h6></label>
                    <input type="email" class="form-control" id="exampleEmailInput1" name="mail" placeholder="name@example.com">
                </div>
                <br>
                <div class="form-group">
                    <label for="exampleInputPassword1"><h6 id="pass">הכנס את האל המבוקש: </h6>(חסוי) </label>
                    <input type="password" class="form-control" id="exampleInputPassword1" name="pass" minlength="3">
                </div>
                <br>
                <label><h6>בחר צבע לפתק</h6></label>
                <br><input type="color"  class="form-control" name="website">
                <br><br>
                <label><h6>הוספת תרומה לקבר רחל?</h6></label>
                <input type="number" class="form-control" name="coffee" value="0" min="0" max="1000">
                <br><br>
                <div class="form-group">
                    <label for="customRange1"><h6>כמה מצוות מקיים?</h6></label>
                    0<input type="range" class="custom-range" id="customRange1" name="temper" min="0" max="613">613
                </div>
                <br>
                <h6>חבר מועדון:</h6>
                    <div class="custom-control custom-checkbox">
                        <input type="checkbox" class="custom-control-input" id="customCheck1" name="interests[]" value="spain">
                        <label class="custom-control-label" for="customCheck1">ספרדי</label>
                    </div>
                    <br>
                    <div class="custom-control custom-checkbox">
                        <input type="checkbox" class="custom-control-input" id="customCheck2" name="interests[]" value="ashkenaz">
                        <label class="custom-control-label" for="customCheck2">אשכנזי</label>
                    </div>
                    <br>
                    <div class="custom-control custom-checkbox">
                        <input type="checkbox" class="custom-control-input" id="customCheck3" name="interests[]" value="else">
                        <label class="custom-control-label" for="customCheck3">אחר</label>
                    </div>
                <br><br>
                <h6>שיטת משלוח:</h6>
                <div class="custom-control custom-radio">
                    <input type="radio" id="customRadio1" class="custom-control-input" name="gender" value="female">
                    <label class="custom-control-label" for="customRadio1">אקספרס לשערי גן עדן (48 שעות)</label>
                </div>
                <br>
                <div class="custom-control custom-radio">
                    <input type="radio"  id="customRadio2" class="custom-control-input" name="gender" value="male">
                    <label class="custom-control-label" for="customRadio2">דרך סולם יעקב (7 ימי עסקים)</label>
                </div>
                <br><br>
                <h6>חפש בקשות נפוצות:</h6>
                <select class="custom-select" name="age">
                    <option value="1">לזכות בלוטו</option>
                    <option value="2">ניצחון בליגת האלופות</option>
                    <option value="3">איחולי החלמה</option>
                    <option value="4">איחולי מחלה</option>
                    <option value="5">בן בכור זכר</option>
                    <option value="6">משרה נחשקת בגוגל</option>
                    <option value="7">לסיים את התואר</option>
                    <option value="8">חופשה בתיאלנד</option>
                    <option value="9">וילה בסביון</option>
                    <option value="10">שיהיה לי כלב</option>
                </select>
                <br><br>
                <div class="form-group">
                    <label for="FormControlTextArea1"><h6>צרף לכלוכים על דתות אחרות להעלאת הסיכוי:</h6></label>
                    <textarea class="form-control" id="FormControlTextArea1" name="address" rows="3" cols="20"></textarea>
                </div>
                <br><br>
                <input type="submit" class="btn btn-info" id="submitBtn" value="הטמן לי פתק!">
                <br><br>
            </form>
